import React, { Component } from 'react'
import axios from 'axios';

class DeleteAppointment extends Component {
    state = {
        content: ''
    }
    // handleChange = (e) => {
    //     this.setState({
    //         content: ''
    //     });
    // }

    // call function to delete a shift
    handleSubmit = (e) => {
        e.preventDefault();
        const id = document.getElementById("SubmitId").value
        const url = 'https://noname.lab.medsolv.net/shifts/';
        axios.delete(url + id)
        document.getElementById("SubmitId").reset();
    };

    render() {
        return (
            <div>
                <form onSubmit={this.handleSubmit}>
                    <label>Einen Termin löschen: </label>
                    <input id="SubmitId" type="text" value={this.state.Title} placeholder="ID der Schicht" />
                    <button type="submit">Senden</button>
                </form>
            </div>
        )
    }
}

export default DeleteAppointment
